import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import App from './App';

import './index.css';
import Page2 from './Page2';
import Page3 from './Page3';
import reportWebVitals from './reportWebVitals';




