      <Router >
      <Routes>
          <Route path="/explore" element={<Page2 />} />
          <Route path="/" element={<App />} />
          <Route path="/bookdetail" element={<Page3 />} />
      </Routes>
    </Router> 


   ,
    document.getElementById('root')
  );


